import{_ as e}from"./chunks/freefly_gps_module.BHDff67v.js";import{_ as t,c as a,o as r,ab as o}from"./chunks/framework.CUflZczI.js";const S=JSON.parse('{"title":"Freefly Systems RTK GPS","description":"","frontmatter":{},"headers":[],"relativePath":"zh/gps_compass/rtk_gps_freefly.md","filePath":"zh/gps_compass/rtk_gps_freefly.md"}'),l={name:"zh/gps_compass/rtk_gps_freefly.md"},i=o('<h1 id="freefly-systems-rtk-gps" tabindex="-1">Freefly Systems RTK GPS <a class="header-anchor" href="#freefly-systems-rtk-gps" aria-label="Permalink to &quot;Freefly Systems RTK GPS&quot;">​</a></h1><p>The <a href="https://store.freeflysystems.com/products/rtk-gps-ground-station" target="_blank" rel="noreferrer">Freefly Systems RTK GPS Module</a> is a multiband <a href="./../gps_compass/rtk_gps.html">RTK GPS module</a> from Freefly Systems that provides highly reliable navigation. The modules can act as either rovers (when installed on an aircraft) or base stations (when plugged into a computer).</p><p>Main features include:</p><ul><li>Multiband (L1/L2) receiver (u-blox ZED-F9P)</li><li>Concurrent reception of all 4 GNSS (GPS, Galileo, GLONASS, BeiDou)</li><li>Built-in magnetometer (IST8310), baro (BMP388), RGB LED, safety switch and safety LED</li></ul><div class="info custom-block"><p class="custom-block-title">INFO</p><p>This module can be used with PX4 v1.9 or above (support for the u-blox ZED-F9P was added in PX4 v1.9).</p></div><p><img src="'+e+'" alt="FreeFly GPS Module"></p><h2 id="where-to-buy" tabindex="-1">Where to Buy <a class="header-anchor" href="#where-to-buy" aria-label="Permalink to &quot;Where to Buy&quot;">​</a></h2><ul><li><a href="https://store.freeflysystems.com/products/rtk-gps-ground-station" target="_blank" rel="noreferrer">Freefly Store</a></li></ul><h2 id="kit-contents" tabindex="-1">Kit Contents <a class="header-anchor" href="#kit-contents" aria-label="Permalink to &quot;Kit Contents&quot;">​</a></h2><p>An RTK GPS kit includes:</p><ul><li>2x GPS modules with antennas</li><li>3m USB C to A cable</li><li>Magnetic quick-mount for base station module (1/4-20 thread for tripod mounting)</li><li>Screws to mount onto a Freefly AltaX</li></ul><h2 id="配置" tabindex="-1">配置 <a class="header-anchor" href="#配置" aria-label="Permalink to &quot;配置&quot;">​</a></h2><p>RTK setup and use on PX4 via <em>QGroundControl</em> is largely plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><p>For the aircraft, you should set the parameter <a href="./../advanced_config/parameter_reference.html#SER_GPS1_BAUD">SER_GPS1_BAUD</a> to 115200 8N1 to ensure that PX4 configures the correct baudrate.</p><h2 id="接线和连接" tabindex="-1">接线和连接 <a class="header-anchor" href="#接线和连接" aria-label="Permalink to &quot;接线和连接&quot;">​</a></h2><p>The Freefly RTK GPS comes with an 8 pin JST-GH connector that can be plugged into a PixHawk autopilot. For use as a base station, the module has a USB-C connector</p><h3 id="针脚定义" tabindex="-1">针脚定义 <a class="header-anchor" href="#针脚定义" aria-label="Permalink to &quot;针脚定义&quot;">​</a></h3><p>The Freefly GPS pinout is provided below. For some autopilots, like the <a href="./../flight_controller/pixhawk-2.html">Hex Cube</a> and <a href="./../flight_controller/pixracer.html">PixRacer</a>, all that is needed is a 1-1 8-pin JST-GH cable.</p><table><thead><tr><th>针脚</th><th>Freefly GPS</th></tr></thead><tbody><tr><td>1</td><td>VCC_5V</td></tr><tr><td>2</td><td>GPS_RX</td></tr><tr><td>0</td><td>GPS_TX</td></tr><tr><td>4</td><td>I2C_SCL</td></tr><tr><td>5</td><td>I2C_SDA</td></tr><tr><td>6</td><td>BUTTON</td></tr><tr><td>7</td><td>BUTTON_LED</td></tr><tr><td>8</td><td>GND</td></tr></tbody></table><h2 id="技术规范" tabindex="-1">技术规范 <a class="header-anchor" href="#技术规范" aria-label="Permalink to &quot;技术规范&quot;">​</a></h2><ul><li>u-blox ZED-F9P GPS Receiver <ul><li>Ultracap backup power for fast (hot-start) restarts</li><li>EMI shield over receiver for improved EMI immunity</li></ul></li><li>IST8310 Magnetometer</li><li>Safety-switch and safety LED</li><li>RGB LEDs for status indication <ul><li>NCP5623CMUTBG I2C Driver</li></ul></li><li>BMP388 Baro on I2C bus</li><li>External, active antenna (Maxtena M7HCT) <ul><li>SMA connector</li></ul></li><li>STM32 MCU for future CAN-based communication <ul><li>FW updates through USB connector</li></ul></li><li>连接性: <ul><li>USB-C</li><li>2-way USB Switch to MCU and F9P</li><li>SMA for active antenna (20mA max)</li><li>4-pin JST-GH CAN Bus (dronecode compliant)</li><li>8-pin JST-GH UART/I2C -** Power:</li><li>Input from either (diode OR&#39;d):</li><li>USB (5V)</li><li>CAN (4.7 to 25.2V)</li><li>(4.7 to 25.2V)</li><li>Power consumption &lt;1W</li></ul></li></ul><h2 id="more-information" tabindex="-1">More Information <a class="header-anchor" href="#more-information" aria-label="Permalink to &quot;More Information&quot;">​</a></h2><p>More information can be found on <a href="https://freefly.gitbook.io/freefly-public/products/rtk-gps" target="_blank" rel="noreferrer">Freefly&#39;s Wiki</a></p>',23),s=[i];function n(d,h,c,u,p,f){return r(),a("div",null,s)}const b=t(l,[["render",n]]);export{S as __pageData,b as default};
